    }
})

function UpdatePost() {
    const style=styleclass()
    return (
        <Box className={style.container}>
            <img src="" alt="banner image" />
            <FormControl>
                <AddIcon />
                <InputBase placeholder="title of blog" /> 
                <Button>Publish</Button>
            </FormControl>
            <TextareaAutosize>
                
            </TextareaAutosize>
        </Box>    
    )
}

